    import React from "react";
    import { Slider } from "@material-ui/core";
    import ProgressBar from '../HeaderAndFooter/header.js';
    import { Button } from 'react-bootstrap'
    import {Link} from 'react-router-dom';


    export default class ChooseEnergy extends React.Component {
      constructor(props) {
        super();
        this.props=props
        this.state = {
          selectedMood: "happy",
          selectedSetting: "public",
          playlistName: ""
        };
      }


    render() {
        const marks = [
            {
              value: 0,
              label: 'Mellow',
            },
            {
              value: 10,
              label: 'Energetic',
            }];

    return (<div className="outsideDiv">
        <ProgressBar step={"3"}/>
        <img className = "heroPic" src={this.props.hero.images.lg} alt="img"></img>
        <div className="divider"></div>
        <div>
          Choose Playlist energylevel
          <Slider
            defaultValue={5.5}
            aria-labelledby="length-slider"
            step={0.1}
            min={0}
            max={10}
            marks={marks}
          />
        </div>
        <Link to="/specPlaylist"><Button variant="btn btn-success btn-lg" >NEXT</Button></Link>
        </div>
    )}
}
